// aria boolean 토글 처리
function toggleBool(props, attrName) {
	props.each(function() {
		$(this).attr(attrName, $(this).attr(attrName) == "false" ? "true" : "false");
	});
}
// footer main menu fixed
var lastScrollTop = 0;
$(window).scroll(function(){
  	var st = $(this).scrollTop();
  	var st2 = $(this).scrollTop() + 10;

	if (window.innerHeight>document.body.scrollHeight-document.body.scrollTop) {
		return;
	}

 	if (st < lastScrollTop) { // up
		$('.comm_menu').removeClass('down');
		$('.quick_menu').removeClass('down');
	 } else if (st > 150) { //down
		$('.comm_menu').addClass('down');
		$('.quick_menu').addClass('down');
	}

   	lastScrollTop = st;
});

function headFixed(){
	var $header = $("#header"),
		$gnb = $(".flick-navigation"),
		$content = $("[data-role='content']"),
		$search = $('.search_inner .fixed_top-search'),
		headerH = $header.outerHeight();

	$(window).scroll(function() {
		var st = $(this).scrollTop(),
			standardT = $('.app_banner').is(':visible') ? $('.app_banner').outerHeight() : 0;
			paddingT = 0;

		if (st > standardT) {
			$header.addClass('fixed');
			paddingT = headerH;

			if ($gnb.length && !$header.find($gnb).length) {
				$gnb.addClass('fixed');
				paddingT += $gnb.outerHeight();
			}

			if ($search.length) {
				$search.addClass('fixed');
				paddingT += $search.outerHeight();
			}

			if ($('.magazine_detail').length) {
				paddingT = 0;
			}
		} else {
			$header.removeClass('fixed');
			$gnb.removeClass('fixed');

			if ($search.length) {
				$search.removeClass('fixed');
			}
		}
		$content.css('padding-top', paddingT);
	});
}

// tab control
function tabInit() {
	$('[role="tabpanel"]').hide().attr('tabindex','-1');
	$('.tab_wrap').each(function(){
		var activeTab = $(this).find($('[aria-selected="true"]'));
		$('#'+activeTab.attr('aria-controls')).show().removeAttr('tabindex');
	});
}
function tabControl(tabThis) {
	var $tabThis = tabThis ? $(tabThis) : this;

	if (!$tabThis.hasClass('disabled')) {
		if(typeof tabThis == "string"){
			$tabThis = tabThis;
			var $tabList = $('[aria-controls="'+$tabThis+'"]').closest('[role="tablist"]'),
				$target = $('#' + $tabThis);
				$tabList.find('[role="tab"]').attr('aria-selected', "false");
				$('[aria-controls="'+$tabThis+'"]').attr('aria-selected', "true");
		}else{
			var $tabList = $tabThis.closest('[role="tablist"]'),
				$target = $('#' + $tabThis.attr('aria-controls'));
				$tabList.find('[role="tab"]').attr('aria-selected', "false");
				$tabThis.attr('aria-selected', "true");
		}
		$target.siblings('[role="tabpanel"]').hide().attr('tabindex','-1');
		$target.show().removeAttr('tabindex');
	}
	// if (!$tabThis.hasClass('disabled')) {
	// 	var $tabList = $tabThis.closest('[role="tablist"]'),
	// 		$target = $('#' + $tabThis.attr('aria-controls'));
	//
	// 	$tabList.find('[role="tab"]').attr('aria-selected', "false");
	// 	$tabThis.attr('aria-selected', "true");
	// 	$target.siblings('[role="tabpanel"]').hide().attr('tabindex','-1');
	// 	$target.show().removeAttr('tabindex');
	// }
}
function radioTabControl(target) {
	var $group = target ? $(target).closest('ul') : $(this).closest('ul');
	if(typeof target == "string"){
		var $group = $('[aria-controls="'+target+'"]').closest('ul');
	}

	$group.find('[aria-controls]').each(function() {
		var $this = $(this),
			$radio = $this.siblings('input[type="radio"]');

		if ($radio.is(':checked')) {
			$this.attr('aria-selected', "true");
			$('#' + $this.attr('aria-controls')).show();
		} else {
			$this.attr('aria-selected', "false");
			$('#' + $this.attr('aria-controls')).hide();
		}
	});
}

// accordion control
function accordionInit() {
	$('[aria-expanded="true"]').each(function(){
		$('#' + $(this).attr('aria-controls')).show();
	});
}
function accordionControl(accThis) {
	var $accThis = accThis ? $(accThis) : this,
		$accWrap = $accThis.closest('.accordion'),
		$target = $('#' + $accThis.attr('aria-controls'));

	if(typeof accThis == "string"){
		$accThis = accThis;
		var $accWrap = $('[aria-controls="'+accThis+'"]').closest('.accordion'),
				$target = $('#' + accThis);
				$accThis = $('[aria-controls="'+accThis+'"]');
	}
	if (!$accWrap.data('allowMulti')) {
		$target.siblings('.acco_panel, .clause_panel').hide();
		$accWrap.find('.acco_trigger').not($accThis).attr('aria-expanded', 'false');
	}

	if ($accThis.attr('aria-expanded') == 'false') {
		$target.show();
		$accThis.attr('aria-expanded', 'true');
	} else {
		$target.hide();
		$accThis.attr('aria-expanded', 'false');
	}
}

// toggle contents
function toggleControl(toggleThis) {
	var $this = toggleThis ? $(toggleThis) : this,
		$target = $('#' + $this.attr('aria-controls'));

	if(typeof toggleThis == "string"){
		$this = $('[aria-controls="'+toggleThis+'"]');;
		$target = $('#' + toggleThis);
	}
	if ($this.attr('aria-pressed') == "true") {
		$target.hide();
		$this.attr('aria-pressed', "false");
	} else {
		$target.show();
		$this.attr('aria-pressed', "true");
	}

	if ($this.parent().parent('ul').length) {
		var $group = $this.parent().parent('ul');

		$group.find('[aria-pressed="true"]').not($this).each(function() {
			$('#' + $(this).attr('aria-controls')).hide();
			$(this).attr('aria-pressed', "false");
		});
	}

	if ($target.find('.btn_close').length) {
		$target.find('.btn_close').off('click').on('click', function() {
			$target.hide();
			$this.attr('aria-pressed', 'false');
		});
	}
}

var currentPosition = 0;
var parentPop;
function setPopupCenter($target) {
	var center = 0,
		targetHeight = $target.find(".contents").height();
	if ($(window).height() < targetHeight) {
		$target.find(".contents").css('margin-top','0');
	} else {
		$target.find(".contents").css({
			"margin-top": ($(window).height() - targetHeight) / 2,
		});
	}

}
var isOpen = false;
function openLayer(target) {
	var $target = $(target),
		$opener = $('#' + $target.attr('aria-labelledby'));

	currentPosition = $(window).scrollTop();
	$target.show();
	if($target.is('[class^="overlay-"]')){
		setPopupCenter($target)
	}
	$(window).resize(function() {
		if ($('[class^="overlay-"]').is(':visible')) {
			setPopupCenter($target);
		}
	});
	toggleBool($opener, 'aria-pressed');
	$('body').addClass('noflow').find('#wrap').css('position','fixed');

	if($('[role="dialog"]:visible').length <= 1 && isOpen == false) {
		$('#wrap').css('top',-currentPosition);
		isOpen = true
	}
	if($('[role="dialog"]:visible').length > 1 && $('[role="dialog"]:visible').attr('class').indexOf('popup_') != -1) {
		parentPop = $('[role="dialog"]:visible').not(target).attr('id');
		var popPosition = $('#'+parentPop).find('.contents').scrollTop();
		$('#'+parentPop).css('oveflow','hidden');
		$('#'+parentPop).find('.contents').css({'position':'fixed','overflow':'hidden'});

	}
}
function closeLayer(target) {
	var $target = $(target);
	var $opener = $('#' + $target.attr('aria-labelledby'));
	$target.hide();
	toggleBool($opener, 'aria-pressed');
	currentPosition = -(parseInt($('#wrap').css('top')));
	if($('[role="dialog"]:visible').length < 1) {
		$('body').removeClass('noflow').find('#wrap').css({'position':'relative','top':0});
		$(window).scrollTop( currentPosition );
		isOpen = false;
	}
	if($('[role="dialog"]:visible').length >= 1 && $('[role="dialog"]:visible').attr('class').indexOf('popup_') != -1) {
		parentPop = $('[role="dialog"]:visible').not(target).attr('id');
		$('#'+parentPop).find('.contents').css({'position':'static','overflow':'scroll'});
	}
}

function popupControl() {
	$('[aria-haspopup="dialog"]').click(function(event){
		var $self = $(this);
		var $target = $( '#' + $self.attr('aria-controls') );
		toggleBool($self,'aria-pressed');
		openLayer($target);
		function closeNfocus() {
			$target.hide();
			$self.focus();
		}
		$(document).keyup(function(e) { // escape key event for work
			if (e.keyCode == 27) {
				closeNfocus();
			}
		});
		return false;
	});
	$('[role="dialog"] .overlay_closer button').click(function(){
		var $self = $(this);
		var $target = $self.parentsUntil('[role="dialog"]').parent("div[role='dialog']");
		var $opener = $( '#' + $target.attr('aria-labelledby') );
		closeLayer($target);
		toggleBool($opener,'aria-pressed');
		$(this).closest('[role="dialog"]').hide();
		$opener.focus();
	});
}

// slide menu
function slideOpen(contsName){
	$('body').addClass('noflow');
	$(contsName).addClass('slide-open');
	$(contsName + ' [class^="overlay-"]').fadeIn();
}
function slideClose(contsName){
	$('body').removeClass('noflow');
	$(contsName).removeClass('slide-open');
	$(contsName + ' [class^="overlay-"]').fadeOut();
}

// gnb
function gnbControl() {
	$('#btn_call-menu').click(function(){
		slideOpen('#side_gnb');
		return false;
	});
	$('#side_gnb .close_overlay').click(function(){
		slideClose('#side_gnb');
		return false;
	});
	$('#side_gnb .nav_list-level2 [aria-haspopup="true"]').click(function(){
		var $self = $(this);
		var $category = $self.parent();
		var $target = $self.next('ul');
		var speed = 300;
		var subCount = $target.find('li').length + 1;
		$category.siblings().css('padding-bottom',0);
		$category.siblings().children('a').attr('aria-expanded','false')
		$category.siblings().children('ul').attr('aria-hidden','true').hide();
		$('#side_gnb .nav_list-level2 a').removeClass('active');
		if( $self.attr('aria-expanded') == 'false' ) {
			$self.addClass('active');
			if( subCount > 0) {
				if( ($category.siblings().length + 1) - $category.index() < 4 ) {
					var tempPadding = parseInt( subCount / 2 ) * 44 + 11;
				} else {
					var tempPadding = parseInt( subCount / 2 ) * 44 + 30;
				}
				$category.animate({
					'padding-bottom':tempPadding
				},speed);
				$self.attr('aria-expanded','true');
				$target.attr('aria-hidden','false');
				$target.css('top',$self.parent().position().top + 100);
				$target.slideDown(speed);
			}
		} else {
			$self.removeClass('active');
			$category.animate({
				'padding-bottom':0
			},speed);
			$self.attr('aria-expanded','false');
			$target.attr('aria-hidden','true');
			$target.slideUp(speed);
		}
	});
	$('#side_gnb .recently h2 a').click(function(){
		$('#side_gnb .recently').toggleClass('open');
		return false;
	});

	if('.app_swipe'.length > 0) {
		serveAppSwipe('16');
	}

}
