// swipe/rolling function
function visualRolling(rollId, $loop, $auto, $delay){
	var $id = eval(rollId);
	if( !$loop ) $loop = false;
	if( !$auto ) $auto = false;
	if( !$delay ) $delay = 500;

	var visualSwipe = new Swiper($id, {
		loop: $loop,
		autoplay: $auto,
		speed: $delay,
		parallax: true,
		pagination: {
			// el: '.swiper-pagination',
			el: '[class*="-pagination"]',
			type: 'progressbar',
		},
	});
}
