function productSwipe(swipeId, $perView, $space, $loop, $center){
	var $id = eval(swipeId);
	if( !$perView ) $perView = "auto";
	if( !$space ) $space = 0;
	if( !$loop ) $loop = false;
	if( !$center ) $center = false;

	var productSwipe = new Swiper($id, {
		slidesPerView: $perView,
		spaceBetween: $space,
		loop: $loop,
		centeredSlides: $center,
		cssWidthAndHeight: true,
		autoHeight: true,
		observer: true,
		// observeParents: true,
		// breakpoints: {
	  //   320: {
	  //     slidesPerView: 1,
	  //     spaceBetween: 10
	  //   },
		// }
	});

	setTimeout(function() {
		if($(window).width() > 600){
			if ($('#'+swipeId).hasClass('famous_rolling')) {
				document.querySelector('.famous_rolling').swiper.destroy();
			}
			if ($('#'+swipeId).hasClass('quick_rolling')) {
				document.querySelector('.quick_rolling').swiper.destroy();
			}
			if ($('#'+swipeId).hasClass('product_swiper-circle')) {
				document.querySelector('.product_swiper-circle').swiper.destroy();
			}
		}
	}, 1);

}

