var starRating = function(){ // star rating
	var $star = $(".rating_set"),$result = $star.find(".rate_counter>em");
	$(document).on("focusin", ".rating_set>.input", function(){
		$(this).addClass("focus");
	}).on("focusout", ".rating_set>.input", function(){
		var $this = $(this);
		setTimeout(function(){
			if($this.find(":focus").length === 0){
				$this.removeClass("focus");
			}
		}, 100);
	}).on("change", ".rating_set :radio", function(){
		$result.text($(this).next().text());
		$star.find('.check_rate').val($(this).next().text());
	}).on("mouseenter", ".rating_set label", function(){
		$result.text($(this).text());
		$star.find('.check_rate').val($(this).text());
	}).on("mouseleave", ".rating_set>.input", function(){
		var $checked = $star.find(":checked");
		if($checked.length === 0){
			$result.text("0");
		} else {
			$result.text($checked.next().text());
			$star.find('.check_rate').val($checked.next().text());
		}
	});
};

// video controller
function videoControl(videoWrap) {
	var media = $(videoWrap + ' video').get(0);
	var control = videoWrap + ' .btn_play';
	function controlShow() {
		$(control).animate({'opacity':1});
		$(mute).animate({'opacity':1});
	}
	function controlHide() {
		$(control).animate({'opacity':0});
		$(mute).animate({'opacity':0});
	}
	function playPauseMedia() {
		if(media.paused) {
			media.play();
			$(control).addClass('stop');
			controlHide();
		} else {
			if($(control).css('opacity') > 0) {
				media.pause();
				$(control).removeClass('stop');
				$(control).blur();
			} else {
				controlShow();
			}

		}
	}
	function muteMedia() {
		if(media.muted) {
			media.muted = false;
			$(mute).removeClass('sound');
		} else {
			media.muted = true;
			$(mute).addClass('sound');
		}
	}
	if($(control).length > 0) {
		$(control).click(playPauseMedia);
		var mute = videoWrap + ' .mute';
		if($(mute).length > 0) {
			$(mute).click(muteMedia);
		}
	}
	// $(control).on('focus',controlShow).on('blur',function(){
	// 	if(media.paused == false) {
	// 		controlHide();
	// 	}
	// });
	media.addEventListener('ended',function(){
		$(control).removeClass('stop');
		controlShow();
	});
}

