// timer
function timeSale( elementName, minutes, seconds, status ) {
	var element, endTime, hours, mins, msLeft, time;
	function endSale(elementName,status) {
		var endTitle;
		if (status == 'soldout') {
			endTitle = '<p>SOLD<strong>OUT</strong></p><p class="flag deadline">품절</p>';
		} else if (status == 'end') {
			endTitle = '<p>TIME<strong>OUT</strong></p><p class="flag deadline">시간종료</p>';
		}
		$(elementName).removeClass('on').addClass("over");
		$(elementName).find('.status').html(endTitle);
	}
	function timeUnits( n ) {
		return (n <= 9 ? "0" + n : n);
	}
	function updateTimer()	{
		msLeft = endTime - (+new Date);
		if ( msLeft < 1000 ) {
			endSale(elementName,'end');
			timer.text("00:00:00");
		} else {
			time = new Date( msLeft );
			hours = time.getUTCHours();
			mins = time.getUTCMinutes();
			timerText = timeUnits( hours ) + ':' + timeUnits( mins )  + ':' + timeUnits( time.getUTCSeconds() );
			timer.text(timerText);
			if (status != 'soldout') {
				setTimeout( updateTimer, time.getUTCMilliseconds() + 500 );
			} else {
				endSale(elementName,'soldout');
			}
		}
	}
	var timer = $( elementName ).find('.timer');
	var endTime = (+new Date) + 1000 * (60*minutes + seconds) + 500;
	updateTimer();
}

