// page history back
// $resultArea 공통 : infinite scroll more data save
// 제외페이지 : member, order, mylotte_
//
$(document).ready(function(){
	var maxStorage = 10;
	var $selector = $("[data-role='content']");
	var $resultArea = $selector.find("[data-more='prdMoreScroll']");
	var fromHistoryBack = false;
	var ellPageHistory = [];
  	var url = location.href;
	var prevUrl = document.referrer;
	var index = -1;

	try {
		ellPageHistory = JSON.parse(sessionStorage.getItem('ellPageHistory'));

		if (ellPageHistory && ellPageHistory.length) {
			if (ellPageHistory[ellPageHistory.length - 1].href == url && (ellPageHistory[ellPageHistory.length - 1].referrer == prevUrl || prevUrl == "")) {
				fromHistoryBack = true;
	  	  	} else {
				if (ellPageHistory.length > 1) {
					if (ellPageHistory[ellPageHistory.length - 2].href == url && ellPageHistory[ellPageHistory.length - 2].referrer == prevUrl) {
	  					fromHistoryBack = true;
						ellPageHistory.pop();
					}
	  			}

				if (!fromHistoryBack) {
					if (ellPageHistory.length > maxStorage) {
		  			  	ellPageHistory.shift();
					} else if (ellPageHistory.length == 1 && ellPageHistory[0].referrer == url) {
						sessionStorage.removeItem('ellPageHistory');
						ellPageHistory = [];
					}
				}
	  	  	}
	  	} else {
			sessionStorage.removeItem('ellPageHistory');
			ellPageHistory = [];
		}

		if (fromHistoryBack) {
			$.each(ellPageHistory, function(key, value) {
				if (value.href && value.href == url) {
					index = key;
				}
			});

			if (index > -1) {
				if ($resultArea.length){
					$resultArea.html('');
					$resultArea.append(ellPageHistory[index].resultArea);
				}

				var sc = ellPageHistory[index].scrollY;
				$('html, body').stop().animate({
					scrollTop: sc
				}, 200);
			}
		}

		if (ellPageHistory.length && url == ellPageHistory[ellPageHistory.length - 1].href && ellPageHistory[ellPageHistory.length - 1].referrer == prevUrl) {
			ellPageHistory.pop();
		}

		sessionStorage.setItem('ellPageHistory', JSON.stringify(ellPageHistory));

		if(!$selector.is('[class^="member"]') && !$selector.is('.order_wrap') && !$selector.is('[class^="mylotte_"]') && !$selector.is('[class^="event_"]') && !$selector.is('.sub-cart')) {
			$(window).on('beforeunload', function() {
				ellPageHistory.push({
					href: url,
					referrer: prevUrl,
					scrollY: $(window).scrollTop(),
					resultArea: $selector.find("[data-more='prdMoreScroll']").html()
				});
				sessionStorage.setItem('ellPageHistory', JSON.stringify(ellPageHistory));
			});
		}
	} catch (e) {};

	console.debug('fromHistoryBack:', fromHistoryBack);
});
